<script>
    
    
function showBusyMessage(message)
{
  var loadingBox = document.querySelector(".loadingBox");
  if (loadingBox)
  {
    loadingBox.textContent = message;
    var loadingWrap = loadingBox.parentNode;
    loadingWrap.style.display = "block";
  }
}
function hideBusyMessage()
{
  var loadingBox = document.querySelector(".loadingBox");
  if (loadingBox)
  {
    loadingBox.textContent = "";
    var loadingWrap = loadingBox.parentNode;
    loadingWrap.style.display = "none";
  }
}

window.addEventListener(
  "mafloadingmessage",
  function(e)
  {
    var eventDetail = e.detail;
    if (typeof eventDetail === 'string')
      showBusyMessage(eventDetail);
    else
      hideBusyMessage();
  },
  false);

</script>
